import React from "react";
import {
  EuiFieldText,
  EuiFormRow,
  EuiDualRange,
  EuiSwitch,
  EuiForm,
  EuiSpacer,
  EuiDatePickerRange,
  EuiDatePicker,
  EuiButton,
} from "@elastic/eui";
import moment from "moment";

import "@elastic/eui/dist/eui_theme_light.css";
import { htmlIdGenerator } from "@elastic/eui/lib/services";

const SidePanel = (props) => {
  return (
    <EuiForm component="form">
      <EuiFormRow label="Discount Range">
        <EuiDualRange
          id={htmlIdGenerator()()}
          value={props.dualValue}
          onChange={props.onRangeChange}
          showInput
          showRange
          minInputProps={{ "aria-label": "Min value" }}
          maxInputProps={{ "aria-label": "Max value" }}
          aria-label="Discount-range"
        />
      </EuiFormRow>
      <EuiSpacer />
      <EuiFormRow label="Brand">
        <EuiFieldText
          name="brand-name"
          value={props.brandName}
          onChange={(e) => props.onBrandChange(e)}
        />
      </EuiFormRow>
      <EuiSpacer />
      <EuiFormRow label="Availability" hasChildLabel={false}>
        <EuiSwitch
          id={htmlIdGenerator()()}
          label="In Stock"
          name="switch"
          value={props.brandName}
          checked={props.isSwitchChecked}
          onChange={props.onSwitchChange}
        />
      </EuiFormRow>
      <EuiSpacer />
      <EuiFormRow label="Creation Date">
        <EuiDatePickerRange
          startDateControl={
            <EuiDatePicker
              selected={props.startDate}
              onChange={props.onStartDateChange}
              startDate={props.startDate}
              endDate={props.endDate}
              maxDate={moment()}
              isInvalid={props.startDate > props.endDate}
              aria-label="Start date"
            />
          }
          endDateControl={
            <EuiDatePicker
              selected={props.endDate}
              onChange={props.onEndDateChange}
              startDate={props.startDate}
              endDate={props.endDate}
              maxDate={moment()}
              isInvalid={props.startDate > props.endDate}
              aria-label="End date"
            />
          }
        />
      </EuiFormRow>
      <EuiButton onClick={props.onClick} fill>
        Filter
      </EuiButton>
    </EuiForm>
  );
};

export default SidePanel;
